        <div className="category-header-in-wrapper">
          <span><h5>House | </h5>Furniture - Appliances - Household</span>
        </div>
        <div className="card-container">
          {products.map((product, _id) => (
            <dis key={product._id} className='card' target='_blank'>
              <div className="card-image-container">
                <img src={`${instance.defaults.baseURL}/${product.image}`} className="card-img-top" alt="" />
              </div>
              <div className="card-body">
                <h5 className="card-title">{product.title}</h5>
                <p className="card-text">{product.description.substring(0, 100)}...</p>
                <a href="#" className="btn btn-primary">More details</a>
              </div>
            </dis>
          ))}
        </div>
      </div>
    </>
  );
}

export default CardDetails;
